import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Cards from '../Cards';
import './Drawing.css'

function Drawing() {
    const[url,setUrl] = useState("getg");

    var categorys = [
        {
            category: "category 3"

        }
        ,
        {
            category: "cat"

        },
        {
            category: "category 4"

        },
        {
            category: "category 5"

        },
        {
            category: "category 6"

