        {
            category: "category 6"

        }
        ,
        {
            category: "cat 1"

        },
        {
            category: "category 2"

        },
        {
            category: "category 3"

        },
        {
            category: "cat 4"

        },
        {
            category: "category 5"

        },
        {
            category: "category 6"

        }
        
    ]
    
    return (
        
            <div className='button-bar-div'>
            
                {  
                    categorys.map((item, index)=>{
                        
                        return(
                            <div className='button-bar-inner' key={index}>
                                <li href='#' className={`btn button-bar-btn color-image${""}`}>{item.category}</li>
                            </div>
                        )
                    })
                    
                }
                <Cards 
                status = {false}
                url = 'getg'

            />
                
            </div>
            
            
    
    )
}

export default Drawing


